import { LEVELS } from './levels.enum';

export class Task {
    name = '';
    desciption = '';
    completed = false;
    level = LEVELS.NORMAL;

    constructor(name, description , completed, level){
        this.name = name;
        this.desciption =description;
        this.completed = completed;
        this.level = level;
    }
}
